import { Route, Routes } from 'react-router-dom';

import Navbar from './components/navbar/Navbar';
import Title from './components/title/Title';
import FilterBar from './components/filterbar/Filterbar';

function App() {
  return (
    <div>
      <Title />
      <Navbar />
      <FilterBar />
      <Routes>
      <Route path="/"/>
      </Routes>
    </div>
  );
}

export default App;
